import React, { Component } from 'react';
import Menu from './menu/Menu';
import Contenido from './usuarios/index/Contenido';
import Crear from './usuarios/crear/Crear';
import Editar from './usuarios/editar/Editar';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import './Dashboard.css';
class Dashboard extends Component {

    constructor(props) {
        super(props);
        this.state = {
            user_to_edit: ''
        }
    }


    userToEdit = (id) => {
        this.setState({
            user_to_edit: id
        })
    }
    render() {
        return (
            <div id="main">
                <header>
                    <div class="navbar-fixed">
                        <nav>
                            <div class="nav-wrapper">
                                <a href="#!" class="brand-logo">Logo</a>
                                <ul class="right hide-on-med-and-down">
                                    <li><a href="sass.html">Administrador</a></li>
                                    <li><a href="badges.html">Configuraci√≥n</a></li>
                                </ul>
                            </div>
                        </nav>
                    </div>
                    <Menu />
                </header>

                <main>
                    <BrowserRouter>
                        <Redirect from="/"
                            to="/" />
                        <Switch>
                            <Route exact path='/' component={() => <Contenido userToEdit={this.userToEdit.bind(this)} />} />
                            <Route exact path='/crear' component={Crear} />
                            <Route exact path='/editar' component={Editar} />

                        </Switch>
                    </BrowserRouter>
                </main>
            </div>
        );
    }
}
export default Dashboard;
